import './css/App.css';
import React from 'react';
import Router from "./routes/Router";
import { BrowserRouter } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <Navbar />
            <Router />
        </BrowserRouter>
    </div>
  );
}

export default App;
